import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faTwitter,
  faFacebook,
  faInstagram,
} from "@fortawesome/free-brands-svg-icons";
import {
  LinkWrapper,
  SocialMediaWrapper,
  Link,
} from "../../StyledComponents/socialMediaItems";

const SocialMedia = ({ iconSize, pattern }) => (
  <SocialMediaWrapper>
    <LinkWrapper>
      <Link pattern={pattern}>
        <FontAwesomeIcon icon={faTwitter} size={iconSize} />
      </Link>
    </LinkWrapper>
    <LinkWrapper>
      <Link pattern={pattern}>
        <FontAwesomeIcon icon={faFacebook} size={iconSize} />
      </Link>
    </LinkWrapper>
    <LinkWrapper>
      <Link pattern={pattern}>
        <FontAwesomeIcon icon={faInstagram} size={iconSize} />
      </Link>
    </LinkWrapper>
  </SocialMediaWrapper>
);

export default SocialMedia;
